svg.script:
      function toggleLayer(e,n) {
        var l = document.getElementById(n);
        if (l.getAttributeNS(null,'style') == 'display:inline') {
          l.setAttributeNS(null,'style','display:none');
          e.target.setAttributeNS(null,'style','font-size:10px;fill:#ff0000');
        } else {
          l.setAttributeNS(null,'style','display:inline');
          e.target.setAttributeNS(null,'style','font-size:10px;fill:#000000');
        }
      }
      function stairs(n1, n2) {
        document.getElementById(n1).setAttributeNS(null, 'style', 'display:none');
        document.getElementById('b-'+n1).setAttributeNS(null, 'style', 'font-size:10px;fill:#ff0000');
        document.getElementById(n2).setAttributeNS(null, 'style', 'display:inline');
        document.getElementById('b-'+n2).setAttributeNS(null, 'style', 'font-size:10px;fill:#000000');
      }
// from http://www.howtocreate.co.uk/tutorials/javascript/browserwindow
      function getScrollXY() {
      var scrOfX = 0, scrOfY = 0;
      if( typeof( window.pageYOffset ) == 'number' ) {
        scrOfY = window.pageYOffset;
        scrOfX = window.pageXOffset;
      } else if( document.body && ( document.body.scrollLeft || document.body.scrollTop ) ) {
        scrOfY = document.body.scrollTop;
        scrOfX = document.body.scrollLeft;
      } else if( document.documentElement && ( document.documentElement.scrollLeft || document.documentElement.scrollTop ) ) {
        scrOfY = document.documentElement.scrollTop;
        scrOfX = document.documentElement.scrollLeft;
      } else {
        document.getElementById('errortext').firstChild.nodeValue = 'Unknown broser type';
      }
      return [ scrOfX+0.1, scrOfY ];
    }

    function moveMenu(evt) {
      var scrollpos = getScrollXY();
      document.getElementById('menu').transform.baseVal.getItem(0).setTranslate(scrollpos[0], scrollpos[1]);
      document.getElementById('unmenu').transform.baseVal.getItem(0).setTranslate(scrollpos[0], scrollpos[1]);
    }

    window.onscroll = moveMenu;
